values
    ("鼓干段温度过高", "", 60, 74, "当前鼓干段温度为#{result}(>上限标准74℃)，温度较高，易导致生球水分剧烈蒸发，生球强度劣化，鼓干段下层球团容易破裂；建议适当提高环冷三段风门开度，降低鼓干段风温。", ""),
    ("鼓干段温度过低", "", 60, 74, "当前鼓干段温度为#{result}(<下限标准60℃)，温度较低，易导致生球水分脱出不及时，后续流程球团内部水分蒸发过快，球团出现分层现象，建议适当降低环冷三段风门开度，提高鼓干段风温。", ""),
    ("抽干段温度过高", "", 250, 280, "当前抽干段温度为#{result}(>上限标准280℃)，温度较高，易导致生球水分蒸发过快，球团内部压力增大，导致生球破裂，建议提高预热二段回风风量，降低抽干段温度。", ""),
    ("抽干段温度过低", "", 250, 280, "当前抽干段温度为#{result}(<下限标准250℃)，温度较低，易导致生球水分脱出不及时，干燥球强度较低，导致生球偏低，生产速率滞后；建议降低预热二段回风风量，提高抽干段温度。", ""),
    ("预热I段温度过高", "", 834, 871, "当前预热I段温度为#{result}(>上限标准871℃)，温度较高，易导致球团压力增加，球团出现分层；建议降低环冷二段风门开度，减少回风风量，降低预热一段温度。", ""),
    ("预热I段温度过低", "", 834, 871, "当前预热I段温度为#{result}(<下限标准834℃)，温度较高，易导致预热球，球团内部压力增大，导致生球破裂，建议提高环冷二段回风风量，降低预热Ⅰ段温度。", ""),
    ("预热II段温度过高", "", 1005, 1030, "当前预热II段温度为#{result}(>上限标准1030℃)，温度较高，窑内温度偏高，回转窑结圈加剧；建议减少窑内喷煤量，降低预热II段温度。", ""),
    ("预热II段温度过低", "", 1005, 1030, "当前预热II段温度为#{result}(<下限标准1005℃)，温度较低，易导致预热球强度偏低，预热球进入窑内出现较为严重的脱粉状况，回转窑结圈加剧；建议提高窑内喷煤量，提高预热II段温度。", ""),
    ("窑尾温度过高", "", 830, 881, "当前窑尾温度为#{result}(>上限标准881℃)，温度较高，窑内温度偏高，回转窑结圈加剧；建议减少窑内喷煤量，降低预热II段温度。", ""),
    ("窑尾温度过低", "", 830, 881, "当前窑尾温度为#{result}(<下限标准830℃)，温度较低，滚动摩擦过程中预热球易出现较为严重的脱粉状况，回转窑结圈加剧；建议提高窑内喷煤量，提高窑内温度。", ""),
    ("窑头温度过高", "", 1121, 1152, "当前窑头温度为#{result}(>上限标准1152℃)，窑内温度较高，回转窑结圈加剧；建议减少窑内喷煤量，降低温度，控制温度在较窄的范围内。", ""),
    ("窑头温度过低", "", 1121, 1152, "当前窑头温度为#{result}(<下限标准1121℃)，温度较低，球团焙烧温度不足，易导致球团质量偏低；建议提高窑内喷煤量，提高窑内温度，保证球团质量满足要求。", ""),
    ("预热I段氧含量过高", "", 19.8, 20.8, "当前预热I段氧含量为#{result}(>上限标准20.8%)，氧含量较高，烟气中易生成氮氧化物，造成污染问题；建议减小环冷二段风门开度，适当降低烟气氧含量。", ""),
    ("预热I段氧含量过低", "", 19.8, 20.8, "当前预热I段氧含量为#{result}(<下限标准19.8%)，氧含量较低，球团氧化速率降低，易导致球团质量偏低；建议提高环冷二段风门开度，增加烟气氧含量，促进球团氧化。", ""),
    ("预热II段氧含量过高", "", 12.2, 13.7, "当前预热II段氧含量为#{result}(>上限标准13.7%)，氧含量较高，窑内煤粉燃烧不足，温度偏低；建议降低风量或者提高喷煤量，促进窑内煤粉燃烧，保证窑内温度和氧含量的稳定性。", ""),
    ("预热II段氧含量过低", "", 12.2, 13.7, "当前预热II段氧含量为#{result}(<下限标准12.2%)，氧含量较低，窑内煤粉过量，烟气中CO含量偏高；建议增加风量或者降低喷煤量，促进窑内煤粉充分燃烧，保证窑内温度稳定和氧含量的稳定性。", ""),
    ("喷煤量过高", "", 4.6, 5.4, "当前喷煤量为#{result}(>上限标准5.4t/h)，喷煤量较高，此时若处于开窑阶段可忽略报警，否则建议降低喷煤量，防止窑内温度过高，结圈加剧。", ""),
    ("喷煤量过低", "", 4.6, 5.4, "当前喷煤量为#{result}(<下限标准4.6t/h)，喷煤量较低，此时若处于开窑阶段可忽略报警，否则建议提高喷煤量，防止窑内温度过低，球团质量变差。", "");
